startGcode:
; info: M303 E0 S200 C8 ; Pid auto-tune 

M140 S{material_bed_temperature}; Start heating up the base
G28 ; Home to top 3 endstops
; Autolevel and adjust first layer
; Adjust this value to fit your own printer!  (positive is thicker)
; This default value is intentionally very high to accommodate the
; variety of print heads used with this printer.  Many of you will
; need tiny values like Z0 or Z0.1.  Use feeler gauges to dial this
; in as accurately as possible.
G29 Z10

; Squirt and wipe ;
M109 S220 ; Wait for the temp to hit 220
G00 X125 Y-60 Z0.1 ;
G92 E0 ;
G01 E25 F100 ; Extrude a little bit to replace oozage from auto levelling
G01 X90 Y-50 F6000 ;
G01 Z5 ;

; Set the extruder to the requested print temperature
M104 S{material_print_temperature}

;Layer height: {layer_height}
;Walls: {wall_thickness}
;Fill: {infill_sparse_density}
;Top\Bottom Thickness: {top_bottom_thickness}
G90 ;absolute positioning
M82 ;set extruder to absolute mode
G4 S1 ;1 millisecond pause to buffer the bep bep 
M300 S2 ;FAB bep bep (start the print, go check the oozing and skirt lines adesion) 
G4 S1 ;1 second pause to reach the printer (run fast)
G92 E0 ;zero the extruded length 
G1 F200 E35    ;slowly extrude 35mm of filament to clean the nozzle and build up extrusion pressure 
G92 E0 ;zero the extruded length again 
;print

G28 ; Home extruder
M107 ; Turn off fan
G90 ; Absolute positioning
M82 ; Extruder in absolute mode
M190 S{material_bed_temperature}
M104 T0 S{material_print_temperature}
M109 T0 S{material_print_temperature}
M104 T1 S{material_print_temperature}
M109 T1 S{material_print_temperature}
;G32 S3 ; auto level
G92 E0 ; Reset extruder position

; start_gcode
M117 Start Clean        ; Indicate nozzle clean in progress on LCD
;
M104 S{material_print_temperature_layer_0} 
M109 S{material_print_temperature_layer_0} 
M109 R{material_print_temperature_layer_0} 
;
M107                    ; Turn layer fan off
G21                     ; Set to metric [change to G20 if you want Imperial]
G90                     ; Force coordinates to be absolute relative to the origin
G28                     ; Home X/Y/Z axis
;
G1 X3 Y1 Z15 F9000      ; Move safe Z height to shear strings
G0 X1 Y1 Z0.2 F9000     ; Move in 1mm from edge and up [z] 0.2mm
G92 E0                  ; Set extruder to [0] zero
G1 X100 E12 F500        ; Extrude 30mm filiment along X axis 100mm long to prime and clean the nozzle
G92 E0                  ; Reset extruder to [0] zero end of cleaning run
G1 E-1 F500             ; Retract filiment by 1 mm to reduce string effect
G1 X180 F4000           ; quick wipe away from the filament line / purge
M117 End Clean          ; Indicate nozzle clean in progress on LCD
;
M117 Printing...
; Begin printing with sliced GCode after here
;

